import React from 'react';
import UserIcon from "./components/user-icon/UserIcon";

const ChatDetails = ({ selectedChat, chatName }) => {
    return (
        <div className="chat-info">
            {selectedChat ? (
                <div>
                    <UserIcon />
                    <p>{chatName}</p>
                </div>
            ) : (
                <p>Select a chat to see info</p>
            )}
        </div>
    );
};

export default ChatDetails;
